import { Button, Container, Menu } from "semantic-ui-react";
import { NavLink } from "react-router-dom";
import logo from './logo.jpg'; 
import './Header.css';


export default function NavBar() {
    return(
        <Menu inverted fixed="top">
            <Container  className="header-container">
                <Menu.Item as={NavLink} to='/' header>
                    <img src={logo} alt="logo" className="header-logo" style={{marginRight: '10px'}}/>
                </Menu.Item>
                <Menu.Item as={NavLink} to='/cars'>
                    <Button
                        content="Wszystkie Auta"
                        size="large"             // Większy przycisk
                        style={{ borderRadius: '25px', padding: '10px 20px' }}  // Dodatkowe style
                    />
                </Menu.Item>
            </Container>
        </Menu>
    )
}
